                children: "Pemerintahan rakyat, yang biasa disebut demokrasi, dipandang sebagai sistem yang menjunjung tinggi\nkesetaraan hak dan tanggung jawab bagi semua warga negara. Sistem politik demokratis ditegakkan\nmelalui pemilihan umum. Pemilu diadakan untuk mencapai kedaulatan rakyat dan menerapkan prinsip serta\nnilai-nilai demokrasi. Selain itu, pemilu dapat meningkatkan kesadaran politik dan mendorong partisipasi\naktif dalam mewujudkan aspirasi demokratis masyarakat Indonesia (Yusuf et al., 2024). Indonesia\nadalah salah satu negara yang menganut sistem demokrasi di mana pemimpin dan wakil rakyat dipilih\nlangsung oleh rakyat melalui pemilihan umum. Pemilu diadakan secara serentak setiap 5 tahun, termasuk\npemilihan Presiden, Wakil Presiden, anggota Dewan Perwakilan Daerah (DPD), Dewan Perwakilan Rakyat (DPR),\ndan Dewan Perwakilan Rakyat Daerah (DPRD) di tingkat provinsi dan kabupaten/kota. Pemilihan Presiden 2024\ntelah dilaksanakan pada Februari 2024. Salah satu isu paling kontroversial dalam pemilu ini adalah\nkelayakan Gibran sebagai calon wakil presiden. Gibran, putra Presiden Joko Widodo, masih berusia di bawah\n40 tahun saat dicalonkan. Situasi ini memicu perselisihan politik dan hukum di masyarakat. Secara keseluruhan,\nperdebatan tentang persyaratan usia minimal untuk calon wakil presiden menyoroti pentingnya integritas\nhukum dan transparansi dalam proses politik. Keputusan politik harus selalu didasarkan pada konstitusi\ndan kepentingan publik, bukan kepentingan individu atau kelompok. Dengan demikian, demokrasi Indonesia\ndapat terus tumbuh dan mempertahankan kepercayaan rakyatnya (Sulistyowati et al., 2024)."
