                children: 'Titik balik krusial dalam perjalanan demokrasi Indonesia terjadi selama Pemilihan Presiden 2024.\nHal ini disebabkan oleh dinamika intens menjelang Pilkada 2024. Presiden Jokowi, sebagai presiden\npetahana, telah banyak disorot selama tahun politik ini. Istilah "presidensi bayangan" sering\ndikaitkan dengan Jokowi pada masa ini, mengacu pada manuver politik yang menempatkan posisi strategis\ndi tangan tokoh-tokoh kunci dan memberikan sinyal dukungan untuk kandidat tertentu. Menurut pengamat politik,\nmeskipun Jokowi secara konstitusional tidak dapat mencalonkan diri lagi, ia tetap menjadi tokoh sentral\ndalam arena politik (Fieda, 2023). Selain isu presidensi bayangan, berbagai kontroversi telah muncul\nmenjelang Pilkada 2024, yang berasal dari elit politik dan ekosistem politik digital. Berbagai media\ntelah mengonstruksi dan melaporkan isu-isu ini, yang muncul dari berbagai kubu. Isu-isu tersebut\nberkisar dari "cawe-cawe" (campur tangan) Presiden Jokowi dari Pilpres hingga Pilkada, diikuti\ndengan klaim intervensi istana untuk mendukung kandidat tertentu, politik dinasti, dan keputusan\nkontroversial Mahkamah Konstitusi tentang batas usia untuk kandidat presiden dan wakil presiden\n(Mudjiyanto et al., 2024). Baru-baru ini, juga telah muncul diskusi luas tentang dugaan manipulasi\nputusan Mahkamah Konstitusi oleh Dewan Perwakilan Rakyat (DPR), tuduhan kandidat boneka, skenario\nkandidat independen, kecurigaan tentang koalisi mega, konflik antara Partai Demokrasi Indonesia\nPerjuangan (PDIP) dan semua partai politik lainnya, serta berbagai plot twist lainnya yang muncul\nmenjelang Pilkada 2024.'
