                children: "Mahkamah Konstitusi kembali menggemparkan setelah melakukan perubahan menjelang Pilkada 2024.\nSekali lagi bertindak sebagai pembuat perubahan besar, setelah keputusannya mengenai batas usia untuk\nkandidat presiden dan wakil presiden dalam Pemilu 2024, Mahkamah Konstitusi kini telah mengeluarkan\npernyataan baru yang tampaknya lebih menguntungkan rakyat dibandingkan keputusan sebelumnya pada\nPilpres 2024. Mahkamah mengeluarkan beberapa putusan penting pada 20 Agustus 2024, tepat satu minggu\nsebelum pendaftaran calon kepala daerah dibuka di Komisi Pemilihan Umum (KPU). Dua isu utama yang\ndisoroti adalah perubahan ambang batas pencalonan untuk kandidat kepala daerah, yang akan disejajarkan\ndengan kandidat independen, dan diskusi mengenai persyaratan usia minimal untuk kandidat kepala\ndaerah (Mantelan & Ramadhan, 2024)."
